export default function Fivecast (props) {

    // const weather = props.weather


    
    const generateDays = (weather) => {
        return weather.map(weather => <div>{weather.data}</div>)
    }

    return(
        <div id='fivecast'>
            <h1>FiveCast</h1>
        {generateDays(weather)}
        </div>
    )
}
